import React, { useState } from "react";
import ReactDOM from "react-dom";
import Button from "./buttons";

function App() {
  return (
    <>
      <div>
        <input type="textbox" name="text_box" />
      </div>
      <div>
        <div>
          <Button number={1} />
          <Button number={2} />
          <Button number={3} />
        </div>
        <div>
          <Button number={4} />
          <Button number={5} />
          <Button number={6} />
        </div>
        <div>
          <Button number={7} />
          <Button number={8} />
          <Button number={9} />
        </div>
      </div>
    </>
  );
}

ReactDOM.render(<App />, document.getElementById("root"));
